volatile int pixel_buffer_start;

short int Buffer1[240][320];
short int Buffer2[240][320];

volatile int *VGA_start;

void plot_pixel(int x, int y, short int line_color) {
    volatile short int *one_pixel_address;
	
	one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
	*one_pixel_address = line_color;
}

void clear_screen() {
	int y, x;
	for (x = 0; x < 320; x++)
		for (y = 0; y < 240; y++)
			plot_pixel (x, y, 0);
}

void swap(int *a, int *b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}

void draw_background(int x, int y, const int screen[240][320]) {
    for (int i = 0; i < 240; i++) {
        for (int j = 0; j < 320; j++) {           
            plot_pixel(x + j, y + i, screen[i][j]);
        }
    }
}

void wait_for_vsync() {
	volatile int *pixel_ctrl_ptr = (int*) 0xff203020; //base address
	
	int status;
	
	*(pixel_ctrl_ptr) = 1;//start synchronization process, write 1 into front buffer address reg
	status = *(pixel_ctrl_ptr + 3); //read status reg
	
	while ((status & 0x01) != 0) { //polling loop waiting for S bit to go to 0
		status = *(pixel_ctrl_ptr + 3);
	} //polling loop/function exits when status bit goes to 0
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // Point to the back buffer
}


int main(void) {
    /* Declare volatile pointers to I/O registers (volatile means that the
    * accesses will always go to the memory (I/O) address */

    set_itimer();
    set_KEY();
    set_PS2();

    int mstatus_value, mtvec_value, mie_value;
    mstatus_value = 0b1000; // interrupt bit mask
    // disable interrupts
    __asm__ volatile ("csrc mstatus, %0" :: "r"(mstatus_value));

    mtvec_value = (int) &handler; // set trap address
    __asm__ volatile ("csrw mtvec, %0" :: "r"(mtvec_value));

    // disable all interrupts that are currently enabled
    __asm__ volatile ("csrr %0, mie" : "=r"(mie_value));
    __asm__ volatile ("csrc mie, %0" :: "r"(mie_value));

    mie_value = 0x450000; // KEY, itimer, mtimer, SW interrupts
    // set interrupt enables
    __asm__ volatile ("csrs mie, %0" :: "r"(mie_value));

    // enable Nios V interrupts
    __asm__ volatile ("csrs mstatus, %0" :: "r"(mstatus_value));

    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    VGA_start = pixel_ctrl_ptr;
    
    // Set front pixel buffer to Buffer 1
    *(pixel_ctrl_ptr + 1) = (int) &Buffer1; //First store the address in the back buffer
    
    // Now, swap the front/back buffers, to set the front buffer location
    wait_for_vsync();
    
    // Initialize a pointer to the pixel buffer, used by drawing functions
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // Clear the front buffer
    
    // Set back pixel buffer to Buffer 2
    *(pixel_ctrl_ptr + 1) = (int) &Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // Point to the back buffer
    
    clear_screen(); // Clear the back buffer

    *HEX3_HEX0_ptr = 0x3f; // show 0 on HEX0
    *(timer_ptr + 1) = 0x0;

    while (1) {
        *LEDR_ptr = counter;
        set_HEX(); // display in decimal
        if(home){
            home_State();
        } else if(game) {
            game_State();
        } else if(game_over){
            game_over_State();
        }
    }
}

void handler (void){
    int mcause_value;
    __asm__ volatile ("csrr %0, mcause" : "=r"(mcause_value));
    if (mcause_value == 0x80000010) { // interval timer
        itimer_ISR();
    } else if (mcause_value == 0x80000012) { // KEY port
        KEY_ISR();
    } else if (mcause_value == 0x80000016) {
        PS2_ISR();
    }
}

void itimer_ISR(void){
    int new_digit;
    volatile int * timer_ptr = (int *) TIMER_BASE;
    *timer_ptr = 0; // clear the interrupt
    new_digit = ones_digit + KEY_dir; // inc/dec the digit
    if (new_digit < 10 && new_digit > -1) {
        ones_digit = new_digit; // decimal (0 to 9)
    }
    
    if (new_digit >= 10) {
        ones_digit = 0;
        tens_digit = tens_digit + 1;
    } else if (new_digit < 0) {
        ones_digit = 9;
        tens_digit = tens_digit - 1;
    }
    
    if (tens_digit > 10){
        tens_digit = 0;
    } else if (tens_digit < 0) {
        tens_digit = 9;
    }

    if(10*tens_digit + ones_digit == 0){
        game = 0;
        game_over = 1;
    }
    set_HEX();
}

void KEY_ISR(void){
    int pressed;
    pressed = *(KEY_ptr + 3); // read EdgeCapture
    *(KEY_ptr + 3) = pressed; // clear EdgeCapture register
    home = 1;
    game_over = 0;
    //KEY_dir = -KEY_dir; // reverse counting direction
}

void PS2_ISR(void) {
    int still_left = 1;
    while (still_left) {
        int ps2_data = *(ps2_ptr);
        int data = ps2_data & 0xFF;
        int RAVAIL = (ps2_data >> 16) & 0xFFFF;

        if(RAVAIL == 0){
            still_left = 0;
        } else if(data == 0x16){
            game = 1;
            home = 0;
        }
    }
}


// Configure the FPGA interval timer
void set_itimer(void){
    // set the interval timer period
    int load_val = clock_rate;
    *(timer_ptr + 0x2) = (load_val & 0xFFFF);
    *(timer_ptr + 0x3) = (load_val >> 16) & 0xFFFF;

    // start interval timer, enable its interrupts
    *(timer_ptr + 1) = 0x7; // STOP = 1, START = 1, CONT = 1, ITO = 1
}

    // Configure the KEY port
void set_KEY(void){
    *(KEY_ptr + 3) = 0xF; // clear EdgeCapture register
    *(KEY_ptr + 2) = 0xF; // enable interrupts for all KEYs
}

void set_PS2(void){
    *(ps2_ptr + 1) = 0b1;
}

void set_HEX(void){
    int ones_hex = bit_codes[ones_digit];
    int tens_hex = bit_codes[tens_digit];

    int output = (tens_hex << 8) | ones_hex;
    *HEX3_HEX0_ptr = output;
}

